void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
	vec2 uv = fragCoord.xy / iResolution.xy;

    vec3 video = texture( iChannel0, uv ).xyz;

    float red = video.rgb.x * 0.9647;
    float green = video.rgb.y * 0.9666;
    float blue = 0.2830 + 0.5654 * video.rgb.z;

	fragColor = vec4(red, green, blue, 1.0) * 1.2;
}
